import cv2
import numpy as np
import base64

image_data = "data:image/jpeg;base64,"

# Extract the encoded data portion of the string
image_data = image_data.split(',')[1]

# Decode the base64 data into a binary format
image_binary = base64.b64decode(image_data)

# Convert the binary data to a numpy array
image_array = np.frombuffer(image_binary, dtype=np.uint8)

# Read the image data into OpenCV format
img = cv2.imdecode(image_array, flags=cv2.IMREAD_COLOR)

# Display the image
cv2.imshow("Image", img)
cv2.waitKey(0)
cv2.destroyAllWindows()
